import React from 'react';

const mystyle = {
  color: "white",
  backgroundColor: "Black",
  padding: "5px",
  fontFamily: "Arial",
  fontSize: "15px"
};


const Form = (props) => {

  return (
<form class="card bg-primary text-white" style={mystyle} onSubmit={(event) => props.handleUserFormSubmit(event)}>
      <label>
        <p> Search</p>
        <input name="username"
        type="text"
        placeholder="GitHub username"
        required
        value={props.formData.username}
        onChange={props.handleFormChange}
      />
      <input
        type="submit"
        value="Submit"
      />
      </label>
    </form>
)};
export default Form;
